window.bookSummaryJSON = "<p>When 16-year-old Tess Kendrick is sent to live with her older sister, Ivy, she has no idea that the infamous Ivy Kendrick is Washington, DC's number-one \"fixer\" - known for making politicians' scandals go away for a price. No sooner does Tess enroll at Hardwicke Academy than she unwittingly follows in her sister's footsteps and becomes DC's premier high school fixer, solving problems for elite teens. </p><p>Secrets pile up as each sister lives a double life...until their worlds come crashing together, and Tess finds herself in the middle of a conspiracy with one of her classmates and a client of Ivy's. Suddenly there is much more on the line than good grades, money, or politics, and the price for this fix might be more than Tess is willing to pay. </p><p>Perfect for fans of <i>Pretty Little Liars</i> and <i>Heist Society</i>, listeners will be clamoring for more in this exciting new series. </p>"; 
